import fetch from './fetch/fetch';
import buildToken from './fetch/token';
import { API_ROOT, DEPLOY_KEY } from './fetch/config';

const Token = buildToken();

const Fetch = fetch(API_ROOT, Token, DEPLOY_KEY, (res: any) => {
  console.log(res); // tslint:disable-line
});

const Api = {
  // 获取城市列表
  getCityList: () => Fetch('/client/commons' + Token.get('api')).get('/city'),
  // 初始化
  getInit: () => Fetch('/client/commons' + Token.get('api')).get('init'),
  // 查询房源
  getRoom: (params?: any) => Fetch('/client/search').get('/bed', params),
  // 查询求租
  getDemand: (params?: any) => Fetch('/client/search' + Token.get('api')).get('demand', params),
  // 高德地址推荐接口
  getMapSuggestion: (params?: any) => Fetch('/client/maps' + Token.get('api')).get('/suggestion', params),
};

export default Api;
